B.yb=new A.hU("Ecosystem","flame","Flame game","flame-game","// Copyright 2024 the Dart project authors. All rights reserved.\n// Use of this source code is governed by a BSD-style license\n// that can be found in the LICENSE file.\n\n/// A simplified brick-breaker game,\n/// built using the Flame game engine for Flutter.\n///\n/// To learn how to build a more complete version of this game yourself,\n/// check out the codelab at https://docs.flutter.dev/brick-breaker.\nlibrary;\n\nimport 'dart:async';\nimport 'dart:math' as math;\n\nimport 'package:flame/collisions.dart';\nimport 'package:flame/components.dart';\nimport 'package:flame/effects.dart';\nimport 'package:flame/events.dart';\nimport 'package:flame/game.dart';\nimport 'package:flutter/material.dart';\nimport 'package:flutter/services.dart';\n\nvoid main() {\n  runApp(const GameApp());\n}\n\nclass GameApp extends StatefulWidget {\n  const GameApp({super.key});\n\n  @override\n  State<GameApp> createState() => _GameAppState();\n}\n\nclass _GameAppState extends State<GameApp> {\n  late final BrickBreaker game;\n\n  @override\n  void initState() {\n    super.initState();\n    game = BrickBreaker();\n  }\n\n  @override\n  Widget build(BuildContext context) {\n    return MaterialApp(\n      debugShowCheckedModeBanner: false,\n      home: Scaffold(\n        body: Container(\n          decoration: const BoxDecoration(\n            gradient: LinearGradient(\n              begin: Alignment.topCenter,\n              end: Alignment.bottomCenter,\n              colors: [\n                Color(0xffa9d6e5),\n                Color(0xfff2e8cf),\n              ],\n            ),\n          ),\n          child: SafeArea(\n            child: Padding(\n              padding: const EdgeInsets.all(16),\n              child: Center(\n                child: FittedBox(\n                  child: SizedBox(\n                    width: gameWidth,\n                    height: gameHeight,\n                    child: GameWidget(\n                      game: game,\n                    ),\n                  ),\n                ),\n              ),\n            ),\n          ),\n        ),\n      ),\n    );\n  }\n}\n\nclass BrickBreaker extends FlameGame\n    with HasCollisionDetection, KeyboardEvents, TapDetector {\n  BrickBreaker()\n      : super(\n            camera: CameraComponent.withFixedResolution(\n                width: gameWidth, height: gameHeight));\n\n  final rand = math.Random();\n  double get width => size.x;\n  double get height => size.y;\n\n  @override\n  FutureOr<void> onLoad() async {\n    super.onLoad();\n    camera.viewfinder.anchor = Anchor.topLeft;\n    world.add(PlayArea());\n    startGame();\n  }\n\n  void startGame() {\n    world.removeAll(world.children.query<Ball>());\n    world.removeAll(world.children.query<Paddle>());\n    world.removeAll(world.children.query<Brick>());\n\n    world.add(Ball(\n      difficultyModifier: difficultyModifier,\n      radius: ballRadius,\n      position: size / 2,\n      velocity:\n          Vector2((rand.nextDouble() - 0.5) * width, height * 0.3).normalized()\n            ..scale(height / 4),\n    ));\n\n    world.add(Paddle(\n      size: Vector2(paddleWidth, paddleHeight),\n      cornerRadius: const Radius.circular(ballRadius / 2),\n      position: Vector2(width / 2, height * 0.95),\n    ));\n\n    world.addAll([\n      for (var i = 0; i < brickColors.length; i++)\n        for (var j = 1; j <= 5; j++)\n          Brick(\n            Vector2(\n              (i + 0.5) * brickWidth + (i + 1) * brickGutter,\n              (j + 2.0) * brickHeight + j * brickGutter,\n            ),\n            brickColors[i],\n          ),\n    ]);\n  }\n\n  @override\n  void onTap() {\n    super.onTap();\n    startGame();\n  }\n\n  @override\n  KeyEventResult onKeyEvent(\n    KeyEvent event,\n    Set<LogicalKeyboardKey> keysPressed,\n  ) {\n    super.onKeyEvent(event, keysPressed);\n    switch (event.logicalKey) {\n      case LogicalKeyboardKey.space:\n      case LogicalKeyboardKey.enter:\n        startGame();\n    }\n    return KeyEventResult.handled;\n  }\n\n  @override\n  Color backgroundColor() => const Color(0xfff2e8cf);\n}\n\nclass Ball extends CircleComponent\n    with CollisionCallbacks, HasGameReference<BrickBreaker> {\n  Ball({\n    required this.velocity,\n    required super.position,\n    required double radius,\n    required this.difficultyModifier,\n  }) : super(\n            radius: radius,\n            anchor: Anchor.center,\n            paint: Paint()\n              ..color = const Color(0xff1e6091)\n              ..style = PaintingStyle.fill,\n            children: [CircleHitbox()]);\n\n  final Vector2 velocity;\n  final double difficultyModifier;\n\n  @override\n  void update(double dt) {\n    super.update(dt);\n    position += velocity * dt;\n  }\n\n  @override\n  void onCollisionStart(\n      Set<Vector2> intersectionPoints, PositionComponent other) {\n    super.onCollisionStart(intersectionPoints, other);\n    if (other is PlayArea) {\n      if (intersectionPoints.first.y <= 0) {\n        velocity.y = -velocity.y;\n      } else if (intersectionPoints.first.x <= 0) {\n        velocity.x = -velocity.x;\n      } else if (intersectionPoints.first.x >= game.width) {\n        velocity.x = -velocity.x;\n      } else if (intersectionPoints.first.y >= game.height) {\n        add(RemoveEffect(\n          delay: 0.35,\n          onComplete: () {\n            game.startGame();\n          },\n        ));\n      }\n    } else if (other is Paddle) {\n      velocity.y = -velocity.y;\n      velocity.x = velocity.x +\n          (position.x - other.position.x) / other.size.x * game.width * 0.3;\n    } else if (other is Brick) {\n      if (position.y < other.position.y - other.size.y / 2) {\n        velocity.y = -velocity.y;\n      } else if (position.y > other.position.y + other.size.y / 2) {\n        velocity.y = -velocity.y;\n      } else if (position.x < other.position.x) {\n        velocity.x = -velocity.x;\n      } else if (position.x > other.position.x) {\n        velocity.x = -velocity.x;\n      }\n      velocity.setFrom(velocity * difficultyModifier);\n    }\n  }\n}\n\nclass Paddle extends PositionComponent\n    with DragCallbacks, HasGameReference<BrickBreaker>, KeyboardHandler {\n  Paddle({\n    required this.cornerRadius,\n    required super.position,\n    required super.size,\n  }) : super(anchor: Anchor.center, children: [RectangleHitbox()]);\n\n  final Radius cornerRadius;\n\n  final _paint = Paint()\n    ..color = const Color(0xff1e6091)\n    ..style = PaintingStyle.fill;\n\n  @override\n  void update(double dt) {\n    super.update(dt);\n\n    final keysPressed = HardwareKeyboard.instance.logicalKeysPressed;\n    if (keysPressed.contains(LogicalKeyboardKey.arrowLeft) ||\n        keysPressed.contains(LogicalKeyboardKey.keyA)) {\n      position.x =\n          (position.x - (dt * 500)).clamp(width / 2, game.width - width / 2);\n    } else if (keysPressed.contains(LogicalKeyboardKey.arrowRight) ||\n        keysPressed.contains(LogicalKeyboardKey.keyD)) {\n      position.x =\n          (position.x + (dt * 500)).clamp(width / 2, game.width - width / 2);\n    }\n  }\n\n  @override\n  void render(Canvas canvas) {\n    super.render(canvas);\n    canvas.drawRRect(\n      RRect.fromRectAndRadius(\n        Offset.zero & size.toSize(),\n        cornerRadius,\n      ),\n      _paint,\n    );\n  }\n\n  @override\n  void onDragUpdate(DragUpdateEvent event) {\n    if (isRemoved) return;\n    super.onDragUpdate(event);\n    position.x = (position.x + event.localDelta.x)\n        .clamp(width / 2, game.width - width / 2);\n  }\n}\n\nclass Brick extends RectangleComponent\n    with CollisionCallbacks, HasGameReference<BrickBreaker> {\n  Brick(Vector2 position, Color color)\n      : super(\n          position: position,\n          size: Vector2(brickWidth, brickHeight),\n          anchor: Anchor.center,\n          paint: Paint()\n            ..color = color\n            ..style = PaintingStyle.fill,\n          children: [RectangleHitbox()],\n        );\n\n  @override\n  void onCollisionStart(\n      Set<Vector2> intersectionPoints, PositionComponent other) {\n    super.onCollisionStart(intersectionPoints, other);\n    removeFromParent();\n\n    if (game.world.children.query<Brick>().length == 1) {\n      game.startGame();\n    }\n  }\n}\n\nclass PlayArea extends RectangleComponent with HasGameReference<BrickBreaker> {\n  PlayArea() : super(children: [RectangleHitbox()]);\n\n  @override\n  Future<void> onLoad() async {\n    super.onLoad();\n    size = Vector2(game.width, game.height);\n  }\n}\n\nconst brickColors = [\n  Color(0xfff94144),\n  Color(0xfff3722c),\n  Color(0xfff8961e),\n  Color(0xfff9844a),\n  Color(0xfff9c74f),\n  Color(0xff90be6d),\n  Color(0xff43aa8b),\n  Color(0xff4d908e),\n  Color(0xff277da1),\n  Color(0xff577590),\n];\n\nconst gameWidth = 820.0;\nconst gameHeight = 1600.0;\nconst ballRadius = gameWidth * 0.02;\nconst paddleWidth = gameWidth * 0.2;\nconst paddleHeight = ballRadius * 2;\nconst paddleStep = gameWidth * 0.05;\nconst brickGutter = gameWidth * 0.015;\nfinal brickWidth =\n    (gameWidth - (brickGutter * (brickColors.length + 1))) / brickColors.length;\nconst brickHeight = gameHeight * 0.03;\nconst difficultyModifier = 1.05;\n")
B.yc=new A.hU("Ecosystem","gemini","Google AI SDK","google-ai-sdk","// Copyright 2024 the Dart project authors. All rights reserved.\n// Use of this source code is governed by a BSD-style license\n// that can be found in the LICENSE file.\n\nimport 'package:flutter/material.dart';\nimport 'package:flutter_markdown/flutter_markdown.dart';\nimport 'package:google_generative_ai/google_generative_ai.dart';\nimport 'package:url_launcher/link.dart';\n\nvoid main() {\n  runApp(const GenerativeAISample());\n}\n\nclass GenerativeAISample extends StatelessWidget {\n  const GenerativeAISample({super.key});\n\n  @override\n  Widget build(BuildContext context) {\n    return MaterialApp(\n      debugShowCheckedModeBanner: false,\n      title: 'Flutter + Generative AI',\n      theme: ThemeData(\n        colorScheme: ColorScheme.fromSeed(\n          brightness: Brightness.dark,\n          seedColor: const Color.fromARGB(255, 171, 222, 244),\n        ),\n        useMaterial3: true,\n      ),\n      home: const ChatScreen(title: 'Flutter + Generative AI'),\n    );\n  }\n}\n\nclass ChatScreen extends StatefulWidget {\n  const ChatScreen({super.key, required this.title});\n\n  final String title;\n\n  @override\n  State<ChatScreen> createState() => _ChatScreenState();\n}\n\nclass _ChatScreenState extends State<ChatScreen> {\n  String? apiKey;\n\n  @override\n  Widget build(BuildContext context) {\n    return Scaffold(\n      appBar: AppBar(\n        title: Text(widget.title),\n      ),\n      body: switch (apiKey) {\n        final providedKey? => ChatWidget(apiKey: providedKey),\n        _ => ApiKeyWidget(onSubmitted: (key) {\n            setState(() => apiKey = key);\n          }),\n      },\n    );\n  }\n}\n\nclass ApiKeyWidget extends StatelessWidget {\n  ApiKeyWidget({required this.onSubmitted, super.key});\n\n  final ValueChanged onSubmitted;\n  final TextEditingController _textController = TextEditingController();\n\n  @override\n  Widget build(BuildContext context) {\n    return Scaffold(\n      body: Padding(\n        padding: const EdgeInsets.all(8.0),\n        child: Column(\n          mainAxisSize: MainAxisSize.min,\n          children: [\n            const Text(\n              'To use the Gemini API, you\\'ll need an API key. '\n              'If you don\\'t already have one, '\n              'create a key in Google AI Studio.',\n            ),\n            const SizedBox(height: 8),\n            Link(\n              uri: Uri.https('makersuite.google.com', '/app/apikey'),\n              target: LinkTarget.blank,\n              builder: (context, followLink) => TextButton(\n                onPressed: followLink,\n                child: const Text('Get an API Key'),\n              ),\n            ),\n            const SizedBox(height: 8),\n            Row(\n              children: [\n                Expanded(\n                  child: TextField(\n                    decoration:\n                        textFieldDecoration(context, 'Enter your API key'),\n                    controller: _textController,\n                    onSubmitted: (value) {\n                      onSubmitted(value);\n                    },\n                  ),\n                ),\n                const SizedBox(height: 8),\n                TextButton(\n                  onPressed: () {\n                    onSubmitted(_textController.value.text);\n                  },\n                  child: const Text('Submit'),\n                ),\n              ],\n            ),\n          ],\n        ),\n      ),\n    );\n  }\n}\n\nclass ChatWidget extends StatefulWidget {\n  const ChatWidget({required this.apiKey, super.key});\n\n  final String apiKey;\n\n  @override\n  State<ChatWidget> createState() => _ChatWidgetState();\n}\n\nclass _ChatWidgetState extends State<ChatWidget> {\n  late final GenerativeModel _model;\n  late final ChatSession _chat;\n  final ScrollController _scrollController = ScrollController();\n  final TextEditingController _textController = TextEditingController();\n  final FocusNode _textFieldFocus = FocusNode(debugLabel: 'TextField');\n  bool _loading = false;\n\n  @override\n  void initState() {\n    super.initState();\n    _model = GenerativeModel(\n      model: 'gemini-pro',\n      apiKey: widget.apiKey,\n    );\n    _chat = _model.startChat();\n  }\n\n  void _scrollDown() {\n    WidgetsBinding.instance.addPostFrameCallback(\n      (_) => _scrollController.animateTo(\n        _scrollController.position.maxScrollExtent,\n        duration: const Duration(\n          milliseconds: 750,\n        ),\n        curve: Curves.easeOutCirc,\n      ),\n    );\n  }\n\n  @override\n  Widget build(BuildContext context) {\n    final history = _chat.history.toList();\n    return Padding(\n      padding: const EdgeInsets.all(8.0),\n      child: Column(\n        mainAxisAlignment: MainAxisAlignment.center,\n        crossAxisAlignment: CrossAxisAlignment.start,\n        children: [\n          Expanded(\n            child: ListView.builder(\n              controller: _scrollController,\n              itemBuilder: (context, idx) {\n                final content = history[idx];\n                final text = content.parts\n                    .whereType<TextPart>()\n                    .map<String>((e) => e.text)\n                    .join('');\n                return MessageWidget(\n                  text: text,\n                  isFromUser: content.role == 'user',\n                );\n              },\n              itemCount: history.length,\n            ),\n          ),\n          Padding(\n            padding: const EdgeInsets.symmetric(\n              vertical: 25,\n              horizontal: 15,\n            ),\n            child: Row(\n              children: [\n                Expanded(\n                  child: TextField(\n                    autofocus: true,\n                    focusNode: _textFieldFocus,\n                    decoration:\n                        textFieldDecoration(context, 'Enter a prompt...'),\n                    controller: _textController,\n                    onSubmitted: (String value) {\n                      _sendChatMessage(value);\n                    },\n                  ),\n                ),\n                const SizedBox.square(dimension: 15),\n                if (!_loading)\n                  IconButton(\n                    onPressed: () async {\n                      _sendChatMessage(_textController.text);\n                    },\n                    icon: Icon(\n                      Icons.send,\n                      color: Theme.of(context).colorScheme.primary,\n                    ),\n                  )\n                else\n                  const CircularProgressIndicator(),\n              ],\n            ),\n          ),\n        ],\n      ),\n    );\n  }\n\n  Future<void> _sendChatMessage(String message) async {\n    setState(() {\n      _loading = true;\n    });\n\n    try {\n      final response = await _chat.sendMessage(\n        Content.text(message),\n      );\n      final text = response.text;\n\n      if (text == null) {\n        _showError('Empty response.');\n        return;\n      } else {\n        setState(() {\n          _loading = false;\n          _scrollDown();\n        });\n      }\n    } catch (e) {\n      _showError(e.toString());\n      setState(() {\n        _loading = false;\n      });\n    } finally {\n      _textController.clear();\n      setState(() {\n        _loading = false;\n      });\n      _textFieldFocus.requestFocus();\n    }\n  }\n\n  void _showError(String message) {\n    showDialog(\n      context: context,\n      builder: (context) {\n        return AlertDialog(\n          title: const Text('Something went wrong'),\n          content: SingleChildScrollView(\n            child: Text(message),\n          ),\n          actions: [\n            TextButton(\n              onPressed: () {\n                Navigator.of(context).pop();\n              },\n              child: const Text('OK'),\n            )\n          ],\n        );\n      },\n    );\n  }\n}\n\nclass MessageWidget extends StatelessWidget {\n  const MessageWidget({\n    super.key,\n    required this.text,\n    required this.isFromUser,\n  });\n\n  final String text;\n  final bool isFromUser;\n\n  @override\n  Widget build(BuildContext context) {\n    return Row(\n      mainAxisAlignment:\n          isFromUser ? MainAxisAlignment.end : MainAxisAlignment.start,\n      children: [\n        Flexible(\n          child: Container(\n            constraints: const BoxConstraints(maxWidth: 480),\n            decoration: BoxDecoration(\n              color: isFromUser\n                  ? Theme.of(context).colorScheme.primaryContainer\n                  : Theme.of(context).colorScheme.surfaceVariant,\n              borderRadius: BorderRadius.circular(18),\n            ),\n            padding: const EdgeInsets.symmetric(\n              vertical: 15,\n              horizontal: 20,\n            ),\n            margin: const EdgeInsets.only(bottom: 8),\n            child: MarkdownBody(data: text),\n          ),\n        ),\n      ],\n    );\n  }\n}\n\nInputDecoration textFieldDecoration(BuildContext context, String hintText) =>\n    InputDecoration(\n      contentPadding: const EdgeInsets.all(15),\n      hintText: hintText,\n      border: OutlineInputBorder(\n        borderRadius: const BorderRadius.all(\n          Radius.circular(14),\n        ),\n        borderSide: BorderSide(\n          color: Theme.of(context).colorScheme.secondary,\n        ),\n      ),\n      focusedBorder: OutlineInputBorder(\n        borderRadius: const BorderRadius.all(\n          Radius.circular(14),\n        ),\n        borderSide: BorderSide(\n          color: Theme.of(context).colorScheme.secondary,\n        ),\n      ),\n    );\n")
